pragma solidity ^0.5;
contract Vote {

    struct VoteInfo {
        string newsurl;
        string username;
        string vote;
        string time;
    }

    address public FFN;

    mapping(string => VoteInfo) Votes;

    //發送已投票的事件
    event voteEvent(string indexed newsurl, string indexed username, string indexed vote, string time);

   	//投票
    function voteInfo(string memory newsurl, string memory username, string memory vote, string memory time, string memory pk) public {

        Votes[pk] = VoteInfo({
            newsurl: newsurl,    
            username: username,
            vote	: vote,
            time: time
        });

        //發射事件
        emit voteEvent(newsurl, username, vote, time);

    }

    function getVoteInfo(string memory newsurl) public view returns (string memory username, string memory vote ,string memory time) {
        username = Votes[newsurl].username;
        vote = Votes[newsurl].vote;
        time = Votes[newsurl].time;
     }     
}
